            inputValue: '',
        
        }
    }

    render() {
        return (
            <Fragment>
                <Card title="公告" bordered={false} style={{ width: 200 }}>
                    <p>来自广东理工大三学生</p>
                    <p>如果你对我有兴趣可以发offer到我邮箱:562392659@qq.com</p>
                </Card>
                <Card title="个人作品" bordered={false} style={{ width: 200,marginTop:"3px" }}>
                    <p>Card content</p>
                </Card>
            </Fragment>
        );
    }

}

export default MainLeft;
